import React, { Component } from "react";
import "./About.css";
import picture from "../../img/pfp.jpg";

class About extends Component {
    constructor(props) {
      super(props);

    }

    render() {
      return (
        <div className='About-container'>
            <img src={picture} className='About-pfp' />

        </div>
      );
    }
  }

  export default About;
